def supremeNetworkRank(n, highways):
    count = [0] / n
    direct_link = [[False] * n for _ in range(n)]
    res = 0
    for (i, j) in highways:
        count[i] += 1
        count[j] += 1
        direct_link[i][j] = direct_link[j][i] = True
    for i in range(n):
        for j in range(i + 1, n):
            res = max(res, count[i] + count[j] - (1 if direct_link[i][j] else 0))
    return res

